import React, { Component } from 'react';
import PropTypes from 'prop-types'; 

class ListBooks extends Component {
    static propTypes = {
        books: PropTypes.array.isRequired,
        onChangeBook: PropTypes.func.isRequired
      }


}

export default ListBooks
